css:
atom-text-editor,
:host {
  background-color: #263238;
  color: #d4d6d7;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #333f46;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #333f46;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #333f46;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #263238;
  color: #526069;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #333f46;
  color: #526069;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #526069;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #526069;
}
atom-text-editor .invisible,
:host .invisible {
  color: #d4d6d7;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #3b4d56;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #526069;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #526069;
}
.entity.name.type {
  color: #ffeb95;
}
.entity.other.inherited-class {
  color: #c3e88d;
}
.keyword {
  color: #bb80b3;
}
.keyword.control {
  color: #ec5f67;
}
.keyword.control.php {
  color: #bb80b3;
}
.keyword.control.at-rule {
  color: #bb80b3;
}
.keyword.control.at-rule .keyword {
  color: #80cbc4;
}
.keyword.operator {
  color: #80cbc4;
}
.keyword.other.special-method {
  color: #6699cc;
}
.keyword.other.unit {
  color: #ffeb95;
}
.storage {
  color: #bb80b3;
}
.storage.modifier.php {
  color: #d4d6d7;
}
.constant {
  color: #ffeb95;
}
.constant.character.escape {
  color: #80cbc4;
}
.constant.numeric {
  color: #ffeb95;
}
.constant.other.color {
  color: #80cbc4;
}
.constant.other.symbol {
  color: #c3e88d;
}
.type {
  color: #bb80b3;
}
.type.property-name {
  color: #80cbc4;
}
.variable {
  color: #ec5f67;
}
.variable.other {
  color: #d4d6d7;
}
.variable.other.less {
  color: #ec5f67;
}
.variable.parameter.function {
  color: #ffeb95;
}
.invalid.illegal {
  background-color: #ec5f67;
  color: #263238;
}
.string {
  color: #c3e88d;
}
.string.regexp {
  color: #80cbc4;
}
.string.regexp .source.ruby.embedded {
  color: #e8a01e;
}
.string.other.link {
  color: #ec5f67;
}
.punctuation.definition.comment {
  color: #526069;
}
.punctuation.definition.begin,
.punctuation.definition.end {
  color: #80cbc4;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #80cbc4;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #6699cc;
}
.punctuation.definition.bold {
  color: #ffeb95;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #bb80b3;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #ffeb95;
}
.support.class {
  color: #bb80b3;
}
.support.function {
  color: #6699cc;
}
.entity.name.function {
  color: #6699cc;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffeb95;
}
.entity.name.section {
  color: #6699cc;
}
.entity.name.tag {
  color: #ec5f67;
}
.entity.other.attribute-name {
  color: #80cbc4;
}
.entity.other.attribute-name.class {
  color: #c3e88d;
}
.entity.other.attribute-name.id {
  color: #e8a01e;
}
.meta.class {
  color: #ffeb95;
}
.meta.link {
  color: #e8a01e;
}
.meta.function-call,
.meta.require {
  color: #6699cc;
}
.meta.selector {
  color: #bb80b3;
}
.meta.tag {
  color: #80cbc4;
}
.meta.separator {
  background-color: #333f46;
  color: #d4d6d7;
}
.none {
  color: #d4d6d7;
}
.markup.bold {
  color: #e8a01e;
  font-weight: bold;
}
.markup.changed {
  color: #bb80b3;
}
.markup.deleted {
  color: #ec5f67;
}
.markup.italic {
  color: #bb80b3;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #6699cc;
}
.markup.inserted {
  color: #c3e88d;
}
.markup.list {
  color: #ec5f67;
}
.markup.quote {
  color: #e8a01e;
}
.markup.raw.inline {
  color: #c3e88d;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #c3e88d;
}
.source.gfm .markup.heading .marker {
  color: #80cbc4;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
